import React, { Component } from 'react';
import "./css/styles.css";
import "./css/w3schools.css";


export default class ContactMe extends Component {
  render() {
    return (
      <div>
      <h3 class="main montserrat large"> CONTACT ME </h3>
      <p class="main montserrat medium">Barry B. Benson, a bee just graduated from college, is disillusioned at his lone career choice: making honey. On a special trip outside the hive, Barry's life is saved by Vanessa, a florist in New York City. As their relationship blossoms, he discovers humans actually eat honey, and subsequently decides to sue them. Love Story is romantic and funny, yet tragic. It is the tale of two college students whose love enables them to overcome the adversities they encounter in life: Oliver Barrett IV, a Harvard jock and heir to the Barrett fortune and legacy, and Jennifer Cavilleri, the quick-witted daughter of a Rhode Island baker.</p>
      </div>
    )
  }
}
